import React from "https://picsum.photos/200/300";
import Software from "https://picsum.photos/200/301";
import Web from "https://picsum.photos/200/302";
const CardData = [
  {
    imgsrc: "https://picsum.photos/200/300",
    title: "App Development",
  },
  {
    imgsrc: Software,
    title: "software Development",
  },
  {
    imgsrc: Web,
    title: "web Development",
  },
];

export default CardData;
